[{"location":"cv/#Past-Expertise-1","page":"Past Expertise","title":"Past Expertise","text":"","category":"section"},{"location":"cv/#Website-AppliGate-1","page":"Past Expertise","title":"Website AppliGate","text":"","category":"section"},{"location":"cv/#","page":"Past Expertise","title":"Past Expertise","text":"Built the AppliGate website using IBM Lotus Domino and Javascript.\nWe built in line with this all internal business applications needed to function as a Lotus Authorized Education Centre in the Netherlands. We used IBM Lotus Notes & - Domino and LotusScript to accomplish it.\nWe redesigned the AppliGate website in 2013 using the Restlet framework, Java, GAE, and Bigtable (JDO).\nWe developed the Event Scheduler for scheduling training courses, using the Restlet framework, Java, and Bigtable","category":"page"},{"location":"cv/#Backend-Android-Medical-Record-App-1","page":"Past Expertise","title":"Backend Android Medical Record App","text":"","category":"section"},{"location":"cv/#","page":"Past Expertise","title":"Past Expertise","text":"We developed the backend for the Android app using the Restlet framework, Java, Lotus Domino","category":"page"},{"location":"cv/#Billing-Manager-1","page":"Past Expertise","title":"Billing Manager","text":"","category":"section"},{"location":"cv/#","page":"Past Expertise","title":"Past Expertise","text":"We automated the billing process as a replacement for a Microsoft Excel-based application using UML, IBM XPages (JSF) and Java. We created a YouTube instruction video using Camtasia.\nWe built a SOAP interface for communication with the online financial administration using Java.\nWe modernized the declaration system using LotusScript and Java.\nWe added a Management Information System, for an overview of the declarations per month by an employee, department, or customer using IBM XPages (JSF) and Java","category":"page"},{"location":"cv/#Online-Absence-Registration-Portal-1","page":"Past Expertise","title":"Online Absence Registration Portal","text":"","category":"section"},{"location":"cv/#","page":"Past Expertise","title":"Past Expertise","text":"We added 2-factor authentication to the online access of the Absence Registration system using the Restlet framework, Java, and JQuery.\nWe maintained the online Absence registration system using Spring and Java.","category":"page"},{"location":"cv/#Internal-Absence-Registration-and-Monitoring-System-1","page":"Past Expertise","title":"Internal Absence Registration and Monitoring System","text":"","category":"section"},{"location":"cv/#","page":"Past Expertise","title":"Past Expertise","text":"We maintained the communication with external systems using LotusScript, XML, and XSLT.\nWe developed a connection with AFAS Profit systems using the Restlet framework, Java, and SOAP.","category":"page"},{"location":"cv/#Links-1","page":"Past Expertise","title":"Links","text":"","category":"section"},{"location":"cv/#","page":"Past Expertise","title":"Past Expertise","text":"AngularJs project - 2013: Multiple Choice - Java, GAE, Restlet, Firebase, AngularJS.\nWe designed the course How to use Managed Beans in XPages, part 1, and part 2.","category":"page"},{"location":"#AppliGate-1","page":"AppliGate","title":"AppliGate","text":"","category":"section"},{"location":"#Focus-1","page":"AppliGate","title":"Focus","text":"","category":"section"},{"location":"#","page":"AppliGate","title":"AppliGate","text":"Appligate's focus is the Julia programming language:","category":"page"},{"location":"#","page":"AppliGate","title":"AppliGate","text":"Online courses.\nIoT projects, with Python too.","category":"page"},{"location":"#Projects-1","page":"AppliGate","title":"Projects","text":"","category":"section"},{"location":"#","page":"AppliGate","title":"AppliGate","text":"Elderly Monitoring. Our mission is to deliver the software for a Raspberry Pi based monitoring system.\nOnline course: Building Business Systems with Julia.","category":"page"},{"location":"#History-1","page":"AppliGate","title":"History","text":"","category":"section"},{"location":"#","page":"AppliGate","title":"AppliGate","text":"AppliGate delivered instructor-led Lotus Notes & Domino training from 1994 on. In 2014 we stopped by providing these courses.","category":"page"},{"location":"#Current-Expertise-1","page":"AppliGate","title":"Current Expertise","text":"","category":"section"},{"location":"#","page":"AppliGate","title":"AppliGate","text":"Julia;\nPython;\nAtom;\nGit;\nDocker;\nRaspberry Pi;\nGoogle Kubernetes Engine.","category":"page"}]
